import React, {Component} from 'react';
export class Login extends Component {
render() {
return (
  
  <form onSubmit={this.onSubmit}>
    <h1>This is admin login </h1>
    <div className='form-group'>
      <label>
        <p>Username</p>
        <input type="text" className='form-control' value={this.state.Username} onChange={this.onUsername}/>
      </label>
      </div>
      <div className='form-group'>
      <label>
        <p>Password</p>
        <input type="password"className='form-control' value={this.state.Username} onChange={this.onChangeTitle} />
      </label>
      </div>
      <div className='form-group'>
        <button type="submit">Submit</button>
      </div>
      
    </form>
);
}
}
